import React from 'react';
import { BrowserRouter as div, Routes, Route, Link } from 'react-router-dom';
import './nav.css';
import './pagina.css';
import Panel from './pagina';
import logo from "../img/pngwing.com.png";

const Navigation = () => {

  const handleLogin = () => {
    // Aquí puedes agregar la lógica para enviar la solicitud de inicio de sesión al backend
    // Puedes usar la función fetch u otra biblioteca para enviar la solicitud POST al endpoint de inicio de sesión
    // Asegúrate de enviar la información necesaria, como el correo electrónico y la contraseña, al backend
  };

  return (
    <div>
      <nav className="nav">
        <button className="login-btn" onClick={handleLogin}>Log In</button>
        <div className="links">
          <div className="product-info">
            <img src={logo} alt="Product" className="product-image" />
          </div>
          <div className='logos'>
            <Link to="/" className="link">Inicio</Link>
          </div>
          <div className='logos'>
            <Link to="/menu" className="link">Menu</Link>
          </div>
          <div className='logos'>
            <Link to="/novedades" className="link">Novedades</Link>
          </div>
          <div className='logos'>
            <Link to="/contacto" className="link">Contacto</Link>
          </div>
          <div className='settingsContenedor' >
          </div>
        </div>
      </nav>
      <Routes>
        <Route path="/menu" element={<Panel />} />
      </Routes>
    </div>
  );
};

export default Navigation;
